window.bookSummaryJSON = "<p>A Beauty and the Beast fantasy romance retelling.</p> <p>A deadly war. A stolen princess. A separation of mates. A secret unearthed.</p> <p>War has come to the Enchanted Vale. The forces of the Below have enacted their evil plan, and both the Spring and Summer Realm are now under their influence. Will Autumn and Winter be next?</p> <p>Rosie and Dayton, High Prince of the Summer Realm, enter a deadly tournament to reclaim the Bow of Radiance and save Summer together. But can they keep fighting their growing feelings for each other?</p> <p>As the Realms fall prey to the Belowâ€™s schemes, Rosie must take her place as the Princess of the Enchanted Vale and fated mate to three of the High Princes.</p> <p>The fight has only just begun...</p> <p>The fourth book in the Beasts of the Briar series, a spicy Beauty and the Beast retelling filled with morally grey characters, a sinfully hot villain, and a princess who has found her Prince Charming. All four of them.</p>"; 
